export const AddFriendModal = ({isOpen, onClose}) => {
    return (
        <Modal isOpen={isOpen} onClose={onClose}>
            <ModalOverlay/>
            <ModalContent>
                <ModalHeader>
                    Add a friend
                </ModalHeader>
                <ModalBody>

                </ModalBody>
                <ModalFooter>
                    <Button colorScheme={"blue"} mr={3} onClick={onClose}>
                        Close
                    </Button>
                </ModalFooter>
            </ModalContent>
        </Modal>
    );
};
